To the death of 2 jawans in LOC CROSS FILEING

OUR HAMBLE HOME MINISTER MUST CHANGE;

RAAG: KADI NINDA ......
GHARANA: BJP;
USTAD RAJ NATH SINGH AND AMIT SHAH.

WE, THE PEOPLE OF INDIA, after having resolved to turn India into a VERY HIGHLY CLASSICAL SUCKULAR DEMO-CRAFTIC RAPE-OFTH-PUBLIC and assure all its citizens:
IN-JUST-AS-IT-IS, social, economic and political;
FREEDOM, from the freedom of thought, expression, belief, faith and adoration;
EQUALITY for WEALTHY POWERFUL; and promote CORRUPTION among all of them
FATALITY assuring the IN-dignity of the individual and the unit and THIS-integrity of the Nation;
IN OUR CONSTITUENT ASSEMBLY, on the twenty-sixth day of the month of November 1949, WE HEREBY ADOPT, WE PROMISE AND GIVE THIS CONSTITUTION TO OURSELVES.
